import styled from "@emotion/styled";
import { Token } from "src/utils/token";
import { PoolIcon } from "src/components/PoolIcon";

interface Props {
    name: string;
    wstaking: string;
    spell: string;
    tokens: Token[];
  }

export const FarmInfo: React.FC<Props> = ({ name, wstaking, spell, tokens }: Props) => {
  return (
    <PoolIcon tokens={tokens} />
  );
};

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;
  img {
    width: 32px;
    height: 32px;
    border-radius: 16px;
  }
`;
